<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 - 293beta2 [ human embryonic kidney cells stably overexpressing the FLAG-tagged beta 2AR - GFP ( green fluorescent protein ) ] cells with the beta-adrenoceptor agonist , isoprenaline , causes

 . DB05876 - selective inhibition by rolipram facilitates the isoprenaline-induced membrane translocation of

 in cardiac myocytes . In the absence of isoprenaline , rolipram-induced inhibition of DB05876 activity in

 - 293beta2 cells acts to stimulate PKA phosphorylation of

 membrane recruitment and

 , a selective oral vasopressin V2 receptor antagonist , ameliorates podocyte injury in puromycin aminonucleoside nephrotic rats . BACKGROUND : Proteinuria caused by glomerular disease is characterized by podocyte injury . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 antagonists are effective in reducing albuminuria , although their actions on glomerular podocytes have not been explored . The objective of this study was to evaluate the effects of tolvaptan , a selective oral V2 receptor antagonist , on podocytes in a puromycin aminonucleoside ( PAN ) - induced nephrosis rat model . METHODS : Rats were allocated to a control , PAN nephrosis , or tolvaptan-treated PAN nephrosis group ( n = 9 per group ) . Urinary protein excretion and serum levels of total protein , albumin , creatinine , and total cholesterol were measured on day 10 . The influence of tolvaptan on podocytes was examined in renal tissues by immunofluorescence and electron microscopy . RESULTS : PAN induced massive proteinuria and serum creatinine elevation on day 10 , both of which were significantly ameliorated by tolvaptan . Immunofluorescence studies of the podocyte-associated proteins nephrin and podocin revealed granular staining patterns in PAN nephrosis rats . In tolvaptan-treated rats , nephrin and podocin expressions retained their normal linear pattern . Electron microscopy showed foot process effacement was ameliorated in tolvaptan-treated rats . CONCLUSIONS : 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 is protective against podocyte damage and proteinuria in PAN nephrosis . This study indicates that tolvaptan exerts a renoprotective effect by affecting podocyte morphology and probably function in PAN nephrosis .

 is a promising pharmacological tool in the treatment of renal edema .</div>

<h2 style="margin: 0">6</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Stimulation of epithelial repair is a likely mechanism for the action of mifepristone in reducing duration of bleeding in users of progestogen-only contraceptives . Many women using progestogen ( P ) - only contraceptives experience uterine bleeding problems . In clinical trials , a single low dose of mifepristone , given to 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00294
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 users at the beginning of a bleeding episode reduced the number of bleeding days by approximately 50 % compared with controls . In this study , a single dose of mifepristone was administered to etonogestrel ( P17813 ) - exposed pseudo-pregnant mice , 5 days after artificial decidualization was induced when the endometrium showed signs of bleeding . Control mice received vehicle alone . Mice were culled 12 - , 18 - , 24 - and 48 - h post-treatment . In the continued presence of P17813 , a single dose of mifepristone stimulated tissue breakdown followed by very rapid repair : most treated tissues were fully restored to the pre-decidualized state by 48 h post-treatment . During repair , proliferating cells ( Ki67 immunostained ) were localized to a band of cells around the basal area in breaking down tissues and to the repairing luminal epithelium and glands . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P06401
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - positive cells were largely localized to the basal area of the breaking down tissue in treated mice compared with decidual cells in controls . Oestrogen receptor-positive cells were observed in the repairing luminal epithelium and glands compared with the decidua and the basal region in control tissues . It is concluded that mifepristone treatment stimulates rapid restoration of luminal epithelial integrity : such action may be a key event in reducing the number of bleeding days observed in women using 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00294

</mark>
 who were treated with a single dose of mifepristone .</div>

<h2 style="margin: 0">7</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">

 - - an emerging treatment for postmenopausal osteoporosis . IMPORTANCE OF THE FIELD : Osteoporosis is a common skeletal disease that is associated with an imbalance in bone remodeling .

 is an investigational fully human monoclonal antibody to receptor activator of NF-kappaB ligand (

 ) , a cytokine member of the

</mark>
 family that is the principal mediator of osteoclastic bone resorption . AREAS COVERED IN THIS REVIEW : The efficacy and safety of denosumab in the management of postmenopausal osteoporosis is evaluated by reviewing the published literature and presentations at scientific meetings through 2009 . WHAT THE READER WILL GAIN : This review focuses on the data on fracture risk reduction and safety endpoints of denosumab in the treatment of postmenopausal osteoporosis . TAKE HOME MESSAGE : In postmenopausal women with osteoporosis , denosumab ( 60 mg by subcutaneous injection every 6 months ) increased bone mineral density , reduced bone turnover markers , and reduced the risk of vertebral , hip and non-vertebral fractures .

 was well tolerated with a safety profile generally similar to placebo . It is a promising emerging drug for the prevention and treatment of postmenopausal osteoporosis .</div>

<h2 style="margin: 0">8</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Branched N-glycans and their implications for cell adhesion , signaling and clinical applications for cancer biomarkers and in therapeutics . Branched N-glycans are produced by a series of glycosyltransferases including N-acetylglucosaminyltransferases and fucosyltransferases and their corresponding genes . Glycans on specific glycoproteins , which are attached via the action of glycosyltransferases , play key roles in cell adhesion and signaling . Examples of this are adhesion molecules or signaling molecules such as integrin and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P12830
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , as well as membrane receptors such as the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01133

</mark>
 and TGF receptors . These molecules also play pivotal roles in the underlying mechanism of a variety of disease such as cancer metastasis , diabetes , and chronic obstructive pulmonary disease ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P48444
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) . Alterations in the structures of branched N-glycans are also hall marks and are useful for cancer biomarkers and therapeutics against cancer . This mini-review describes some of our recent studies on a functional glycomics approach to the study of branched N-glycans produced by N-acetylglucosaminyltransferases III , IV , V and IX ( Vb ) ( GnT-III , GnT-IV , V and IX ( Vb ) ) and fucosyltransferase 8 ( Fut 8 ) and their patho-physiological significance , with emphasis on the importance of a systems glycobiology approach as a future perspective for glycobiology .</div>

<h2 style="margin: 0">9</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Clot penetration and retention by plasminogen activators promote fibrinolysis .

</mark>
 ( TNK ) that circulate with longer life-spans and in theory should have more extended potency in vivo . One reason for this paradox is the inability to assign units of activity to plasminogen activators based on specific biologically relevant standards , which impairs objective comparison . Here , we compare clot permeation , retention and fibrinolytic activities of tPA , TNK and Ret in vitro and clot composition over time with outcome in a mouse model of disseminated pulmonary microembolism ( ME ) . When clots were incubated in the continuous presence of drug , tPA , TNK and Ret lysed fibrin clots identically in the absence of PA inhibitor - 1 ( e . g . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) . Ret , which has lower fibrin affinity and greater susceptibility to inhibition by 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 than tPA , was less effective in lysing plasma clots , while TNK was less effective when the fibrin content of the clots was enhanced . However , when clots were afforded only brief exposure to drug , as occurs in vivo , Ret showed more extensive clot permeation , greater retention and lysis than tPA or TNK . These results were reproduced in vivo in a mouse model of ME . These studies indicate the need for more relevant tests of plasminogen activator activity in vitro and in vivo and they show that clot permeation and retention are important potential predictors of clinical utility .</div>

<h2 style="margin: 0">10</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Gender difference in the activity but not expression of estrogen receptors alpha and beta in human lung adenocarcinoma cells . The higher frequency of lung adenocarcinoma in women smokers than in men smokers suggests a role for gender-dependent factors in the etiology of lung cancer . We evaluated estrogen receptor ( ER ) alpha and beta expression and activity in human lung adenocarcinoma cell lines and normal lung fibroblasts . Q8N1N2 - length ERalpha and ERbeta proteins were expressed in all cell lines with higher ERbeta than ERalpha . Although estradiol ( E ( 2 ) ) binding was similar , E ( 2 ) stimulated proliferation only in cells from females , and this response was inhibited by anti-estrogens 4 - hydroxytamoxifen ( DB04468 ) and DB00947 . In contrast , E ( 2 ) did not stimulate replication of lung adenocarcinoma cells from males and DB04468 or ICI did not block cell proliferation . Similarly , transcription of an estrogen response element-driven reporter gene was stimulated by E ( 2 ) in lung adenocarcinoma cells from females , but not males .

 and other ER coregulators may contribute to differences in estrogen responsiveness between lung adenocarcinoma cells in females and males .</div>
